import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";

// root는 public 폴더의 index.html에 있음
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
